import "./App.css";
import Logo from "./Components/Image/logo.png";

function App() {
  return (
    <>
      <div className="container">
        <div className="row">
          <div className="logo">
            <img src={Logo} alt="Logo" />
          </div>
          {/* form  */}
          <div className="form">
            <form action="">
              <div className="top_Logo">
                <div className="firstLine"> 1</div>
                <div className="secoundLine">2</div>
                <div className="threeLine"></div>
              </div>
            </form>
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
